from unittest import TestCase
from unittest.mock import patch

import timeout_decorator

from komand_get_url.actions.get_file.schema import Input
from komand_get_url.triggers.poll_file import PollFile
from unit_test.util import Util

actual = None


def timeout_pass(error_callback=None):
    def func_timeout(func):
        def func_wrapper(*args, **kwargs):
            try:
                return func(*args, **kwargs)
            except timeout_decorator.timeout_decorator.TimeoutError as e:
                if error_callback:
                    return error_callback()

                return None

        return func_wrapper

    return func_timeout


class MockTrigger:
    actual = None

    @staticmethod
    def send(params):
        MockTrigger.actual = params


def check_error():
    expected = {
        "bytes": "",
        "status_code": 200,
    }
    if MockTrigger.actual == expected:
        return True

    TestCase.assertEqual(TestCase(), MockTrigger.actual, expected)


# Test class
class TestPollFile(TestCase):
    @classmethod
    def setUpClass(cls) -> None:
        cls.action = Util.default_connector(PollFile())

    @timeout_pass(error_callback=check_error)
    @timeout_decorator.timeout(2)
    @patch("six.moves.urllib.request.urlopen", side_effect=Util.mocked_request)
    @patch("komand_get_url.triggers.PollFile.send", side_effect=MockTrigger.send)
    @patch("komand.helper.open_cachefile", side_effect=Util.mock_for_cache_creation)
    @patch("komand_get_url.util.utils.Utils.create_url_meta_file")
    def test_poll_documents(self, mock_get, mock_send, mock_cache, mock_create_url_meta_file):
        self.action.run({Input.URL: "https://test.com/v1/test.pdf", Input.IS_VERIFY: False})
